function get_tags(){$.ajax({cache:!0,type:"GET",dataType:"json",async:!1,url:document.URL,success:function(t){tagList=t}})}var tagList=[];$(document).ready(function(){get_tags();var t=new Array,e=new Array;for(var n in tagList)t.push(n),e.push(tagList[n]);var i={labels:t,datasets:[{fillColor:"rgba(151,187,205,0.5)",strokeColor:"rgba(151,187,205,1)",pointColor:"rgba(151,187,205,1)",pointStrokeColor:"#fff",data:e}]};myNewChart=new Chart($("#canvas").get(0).getContext("2d")).Line(i),$("#father").click(function(){$("#role").value="father"})});